webpackJsonp([0xb19dc34fc6fc],{4952:function(e,t){e.exports={pathContext:{group:[{node:{fields:{title:"Aliens at Roswell",date:"09 Sep 2006",slug:"/2006-09-09-aliens-at-roswell/",tags:"Y2006"},html:'<p>They *are* among us. <a href="http://www.ice.gov/pi/news/newsreleases/articles/060829roswell.htm">Immigration arrests 15 aliens in Roswell working for U.S. military contractor</a>. Now that\'s what I call outsourcing. </p>\n<p>Via <a href="http://pages.prodigy.net/thomasn528/blog/2006_09_03_newsarcv.html#115768215657363003">newsrack</a>.</p>'},next:{fields:{title:"New Hamburg Expat Blogger",date:"08 Sep 2006",slug:"/2006-09-08-new-hamburg-expat-blogger/"}},previous:{fields:{title:"Grade School Week One",date:"09 Sep 2006",slug:"/2006-09-09-grade-school-week-one/"}}},{node:{fields:{title:"New Hamburg Expat Blogger",date:"08 Sep 2006",slug:"/2006-09-08-new-hamburg-expat-blogger/",tags:"Y2006"},html:'<p>We now have a new expat blogger in Hamburg... <a href="http://emilyatmills.blogspot.com/">Emily</a>, who <a href="http://emilyatmills.blogspot.com/2006/09/herzlich-willkommen.html">arrived in town this week</a>. Welcome to the most beautiful city in the world*. It takes a few months to become a real <a href="http://www.jbittner.com/germany/2006/07/second-whiney-expat-bloggers-in.html">whiney expat</a>, but welcome to the club!</p>\n<ul>\n<li>(when the sun shines, which is about 2 weeks a year. The 2 weeks for this year are already done. But we\'ve still got several dozen rainy days to go yet.)</li>\n</ul>'},next:{fields:{title:"PapaScott Sells Out",date:"07 Sep 2006",slug:"/2006-09-07-papascott-sells-out/"}},previous:{fields:{title:"Aliens at Roswell",date:"09 Sep 2006",slug:"/2006-09-09-aliens-at-roswell/"}}},{node:{fields:{title:"PapaScott Sells Out",date:"07 Sep 2006",slug:"/2006-09-07-papascott-sells-out/",tags:"Y2006"},html:'<p>A couple of days ago I reinserted <a href="http://google.com/adsense/">Google AdSense</a> ads on my archive pages. If after my complaining about <a href="http://www.papascott.de/archives/2006/04/22/googles-china-problem/">Google in China</a> anyone thinks I\'m selling out, they\'re right.</p>'},next:{fields:{title:"Spiegel Online Relaunch",date:"06 Sep 2006",slug:"/2006-09-06-spiegel-online-relaunch/"}},previous:{fields:{title:"New Hamburg Expat Blogger",date:"08 Sep 2006",slug:"/2006-09-08-new-hamburg-expat-blogger/"}}}],pathPrefix:"",first:!1,last:!1,index:194,pageCount:1101}}}});
